	ob_start();
	$heading_color = get_theme_mod('heading_color');
	?>
	h2.entry-title > a {
	color:<?php echo $heading_color; ?>
	}
	<?php
	file_put_contents( plugin_dir_path(dirname(__DIR__)).'inc/dynamic_css/dynamic_style.css',ob_get_clean());
