function quick_start_dynamic_css(){
	wp_enqueue_style('dynamic_css',plugin_dir_url(dirname(__DIR__)).'inc/dynamic_css/dynamic_style.css');
}
add_action('wp_enqueue_scripts','quick_start_dynamic_css');

